import React from 'react'
import {SidebarData} from './SidebarData.js'

function Sidebar() {
    return (
        <div className="Sidebar">
            <ul className="SidebarList">
                {SidebarData.map((value, key) => {
                    return (
                        <li>
                            <div id='icon'>{value.icon}</div>
                        </li>
                    )
                })};
            </ul>
        </div>
    )
}

export default Sidebar
